<button aria-label="Toggle sound" id="mute-toggle">🔇</button><script id="mute-toggle-script">
(function(){
  var v = document.querySelector('video');
  var b = document.getElementById('mute-toggle');
  if(!v || !b) return;
  function sync(){ b.textContent = v.muted ? '🔇' : '🔊'; }
  try { if (v.autoplay) v.muted = true; } catch(e){}
  b.addEventListener('click', function(){
    try{
      v.muted = !v.muted;
      if (!v.muted && v.paused) { v.play().catch(function(){}); }
      sync();
    }catch(e){}
  });
  v.addEventListener('loadedmetadata', sync);
  v.addEventListener('volumechange', sync);
  document.addEventListener('visibilitychange', sync);
  sync();
})();
</script><script id="force-views-robust">
(function(){
  var TARGET = "1,372";
  function setViews(root){
    try{
      var spans = (root||document).querySelectorAll('span.text-sm');
      for (var i=0;i<spans.length;i++){
        var s = spans[i];
        var t = (s.textContent||'').trim();
        if (/^\d{1,3}(,\d{3})*$/.test(t) && t !== TARGET) {
          s.textContent = TARGET;
        }
      }
    }catch(e){}
  }
  var scheduled = false;
  function schedule(){
    if (scheduled) return;
    scheduled = true;
    requestAnimationFrame(function(){ scheduled = false; setViews(); });
  }
  if (document.readyState === "loading") document.addEventListener("DOMContentLoaded", setViews);
  else setViews();
  try {
    new MutationObserver(function(muts){
      for (var i=0;i<muts.length;i++){
        var m = muts[i];
        if (m.type === "characterData" || (m.addedNodes && m.addedNodes.length)) { schedule(); break; }
      }
    }).observe(document.body || document.documentElement, { characterData:true, childList:true, subtree:true });
  } catch(e){}
  setTimeout(setViews, 1500);
})();
